import * as React from 'react';
import Box from '@mui/material/Box';
export default function BoxSystemProps({ job }) {
  return (
    <Box
      height={200}
      width={300}
      my={4}
      display="grid"
      alignItems="center"
      gap={2}
      p={2}
      marginLeft={5}
      sx={{ border: '2px solid grey' }}
    >
    Toolbar
    {job.title}
    {job.skills}
    </Box>
  );
}
